INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (31114071, 1, 11, 1, 0.5, 103111, 10, 31114, 0, 0, "本日は、私の誕生日を祝っていただいて\nありがとうございます……\n豪華なケーキまで用意していただいて、\n何かお返しを考えないといけませんね。");
