INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (31114075, "", 21, 0, "", "vo_wac_31114", 0, 31114, "", "", "vo_wac_31114_001");
INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (31114076, 1, 11, 1, 0.5, 100711, 10, 31114, 0, 0, "それならプリンがいいの～！\nこのケーキと同じくらい、でっかい\nプリンが食べたいの～！");
INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (31114077, "", 91, "", "", 0, "", 31114, "", "", "");
