INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (38614078, "", 21, 0, "", "vo_wac_38614", 0, 38614, "", "", "vo_wac_38614_002");
INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (38614079, 1, 11, 1, 0.5, 105111, 10, 38614, 0, 0, "いえ、あのね？\nテーブルの下に、未使用のロウソクが\n大量に袋詰めしてあるんだけど。\nこれは、なに？");
INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (38614080, "", 91, "", "", 0, "", 38614, "", "", "");
